import React from 'react'

const Todo = ({todos}) => {
  return (
    <div>
        {todos.map((todo, index)=>{
            return(
                <div key={index}>
                    <h1>{todo.title}</h1>
                    <h1>{todo.description}</h1>
                    <button>{todo.completed? "Completed":"Mark as complete"}</button>
                </div>
            )
        })}

    </div>
  )
}

export default Todo
